import {Link} from 'react-router-dom'
import Button from 'react-bootstrap/Button'
import Card from 'react-bootstrap/Card'
function Productos(props) {
  return (
    <Card style={{ width: '18rem' }}>
      <Card.Body>
        <Card.Title>{props.productos.data().name}</Card.Title>
        <Card.Text>
        {props.productos.data().price}
        </Card.Text>
        <Link to={"/productos/"+props.productos.id}><Button variant="primary">Ver</Button></Link>
        <Link to={"/productos/editar/"+props.productos.id}><Button variant="primary">Editar</Button></Link>
      </Card.Body>
    </Card>
  );
}

export default Productos;
